import React from 'react';
import style from "./First.module.css";
const First = () => {
    return (
        <div className={style.first}>
            <div className={style.first__title}>Добро пожаловать в ГЭНДАЛЬФ!</div>
            <div className={style.first__subtitle}>Мы готовы поделиться секретом, почему любим компанию,
                в которой работаем. Если тебе будут близки наши ценности и идеи,
                то смело записывайся на собеседование!</div>
            <div>
                <div>Почему мы</div>
                <div></div>
            </div>
        </div>
    );
};

export default First;
